import DetailedPalette from "./DetailedPalette"
import Palette from "./Palette";

const Home = (props) => {

    const [palette, setPalette] = useState({
        one : '#cd84f1',
        two : '#ffcccc',
        three : '#ff4d4d',
        four : '#c56cf0',
        five : '#ffb8b8',
        six : '#ff3838',
        seven : '#32ff7e',
        eight : '#7efff5',
        nine : '#18dcff'
        
      })

    return ( 
        <div className="container">
            <h1>this is the Homepage</h1>
            <div className="palette">
                <Palette palette={palette}/>
                <DetailedPalette/>
                <DetailedPalette/>
            </div>
        </div>
     );
}
 
export default Home;
